import {
  BrowserRouter as Router,
  Route,
  Redirect,
  Switch
} from 'react-router-dom';

import './App.css';
import Home from './pages/Home/Home';
import Login from './pages/Login/Login2';
import Register from './pages/Login/Signup2';

const App = () => {
  return (
    <Router>
      {/* <Navbar/> */}
      <main>
        <Switch>
          <Route path="/" exact>
            <Home />
          </Route>

          <Route path="/login" exact>
            <Login />
          </Route>

          <Route path="/register" exact>
            <Register />
          </Route>

          <Redirect to="/" />
        </Switch>
      </main>
    </Router>
  );
}

export default App;
